import livros from './dadosUltimosLancamentos';

function UltimosLancamentos() {
    return (
        <section>
            <h2>ULTIMOS LANCAMENTOS</h2>
            {livros.map(livro => (
                <img key={livro.id} src={livro.src} alt={livro.alt} />
            ))}
        </section>
    );
}

export default UltimosLancamentos;
